                                          "caption": {
                                            "text": "A massive congratulations to \u0040nsarikhani who has won our People\u2019s Choice Award! \ud83d\udc4f\n \nNima\u2019s dreamy image captures the moment a polar bear drifts off to sleep on a bed made of ice against stunning pink and blue sky. \u2744\ufe0f\n \n\u2018It is such an honour to have my work recognised alongside the many amazing winners of the Wildlife Photographer of Year.\n\nWinning this award in this prestigious competition truly feels like a dream come true! Thank you so much to everyone who took the time to vote for it.\n \nI love that this image stirs so much emotion in people. Some find it happy and peaceful, and some find it somehow melancholic or ominous.\n\nWhilst climate change is the biggest challenge we face, I hope that this photograph also inspires hope; there is still time to fix the mess we have caused.\u2019\n\nTap the link in our bio to explore more about the winning People\u2019s Choice Award image! \ud83d\udcf7\n\n#WPY #WildlifePhotographerOfTheYear #WildlifePhotography #NaturePhotography #WPYPeoplesChoice #ClimateChange #PolarBear",

                                            "text": "\u201cDevils Horns\u201d sunrise! \ud83c\udf19\ud83d\ude33 \nWhat picture is your favorite 1-5?\ud83c\udf05\n\nIt was captured in Qatar, during a partial eclipse during sunrise in 2019 by \u0040eliasastro\n\nHere is what he had to say about it - \u201cThe sunrise of 26 December 2019 as seen from Qatar was not a common one. The sun rose partially eclipsed, as an annular solar eclipse was in progress. The sun rose in two parts that gave the impression of horns. Thus, it was given the nickname of the evil sunrise. For me it was the most stunning sunrise i've ever seen.\u201d\n\n\ud83d\udcf8 by \u0040eliaschasiotis \n\nFollow for more space content \u0040astrotaner \ud83d\udd2d",
